import React, { Component } from "react";
import "./Day.css";

class Day extends Component {
  render() {
    const { data } = this.props;
    console.log("data", data);
    if (!data) return null;

    const { items } = data.main;
    return (
      <div className="day-container">
        <strong>{items} celsius</strong>
      </div>
    );
  }
}

export default Day;
